      "body": "_Assalamualaikum wr wb._ \n\nSelamat malam bapak dan ibu, mohon izin utk menginformasikan adanya *Penggantian Jadwal KBM* untuk minggu ini. \n\nYang sedianya,..sesuai Surat Edaran No.686 Ttg Perpanjangan Kegiatan Belajar Di Rumah ( _Home Learning III_ ) akan di mulai Selasa 14 April 2020,\n\n..dengan ini disampaikan bahwa dalam 5 hari ke depan (14 s.d 18 April 2020) KBM untuk Mata Pelajaran *ditiadakan* dan di ganti dengan KBM Alumni Mengajar.\n\nProgram ini adalah tindak lanjut dari hasil evaluasi KBM _Home Learning_ yg masuk ke Unit Kurikulum dan tentu saja bekerjasama dengan Unit Hubinkom sbg salah satu sarana mendekatkan alumni dengan almamater dan adik-adik kelasnya guna memperluas wawasan ttg peluang setelah lulus SMK dengan segala pernak-perniknya. \n\nNantinya pada setiap sesi Alumni Mengajar, para siswa di minta utk mengisi *Refleksi*, dengan mencatatkan *3 poin penting* dari hal yg disampaikan oleh para alumni. \nRefleksi ini digunakan sbg salah satu unsur *penilaian karakter* oleh Unit Kesiswaan yg sekaligus digunakan sebagai absensi siswa.\n\nAdapun program ini diawali dgn *_trial_ dan kesiapan perangkat*, yg akan dilaksanakan _insya Allah_ pada *Selasa, 14 April 2020*, dan akan dipandu oleh pak @6281390916665 \n\nUntuk Surat Edaran, Jadwal Alumni Mengajar serta Panduan Pelaksanaan Program akan disampaikan besok.\n\nDemikian informasi yg kami sampaikan.\nAtas perhatian, bantuan, kerjasama dan partisipasi aktifnya diucapkan terimakasih \n\n_Wassalamualaikum wr wb._ \n\nTtd. Tim Kurikulum\n\n*Note :*\nKepada Bpk ibu wali kelas X, XI dan XII harap menginformasikan hal tersebut kepada para siswa asuhnya. Terimakasih 😊",
