      "body": "Bapak/ibu Wali Kelas X, XI, dan XII ysh, terkait dengan persiapan alumni mengajar, mohon bapak/ibu wali kelas sementara dapat menginformasikan kepada peserta didiknya masing² sbb :\n\n1. Setiap peserta didik *diwajibkan* memiliki akun facebook, untuk itu bagi yang belum memiliki akun tersebut agar dapat create akun facebook sekarang\n\n2. Pada pukul 15.00 hari ini (Selasa) setiap peserta didik dimohon untuk standby mengikuti panduan cara live on facebook dan sekaligus akan dilakukan trial live on facebook\n\n3. Bersamaan dengan pelaksanaan trial live on facebook, kegiatan alumni mengajar selama 4 hari kedepan secara resmi akan dibuka oleh kepala sekolah.",
